import React from "react";
import { Pie } from "react-chartjs-2";
import { Chart as ChartJS, ArcElement, Tooltip, Legend } from "chart.js";
import { Box, Typography, Paper, List, ListItem, ListItemText } from "@mui/material";

ChartJS.register(ArcElement, Tooltip, Legend);

const AshaDashboard = () => {
  // Sample data for the pie chart
  const data = {
    labels: ["Fever", "Cough", "Headache", "Stomach Pain", "Other"],
    datasets: [
      {
        data: [30, 20, 15, 10, 25], // Example disease ratios
        backgroundColor: ["#FF6384", "#36A2EB", "#FFCE56", "#4BC0C0", "#9966FF"],
      },
    ],
  };

  // Sample prescriptions
  const prescriptions = [
    { id: 1, patient: "John Doe", prescription: "Take Paracetamol for fever." },
    { id: 2, patient: "Jane Smith", prescription: "Drink warm water for cough." },
  ];

  return (
    <Box sx={{ padding: 3 }}>
      <Typography variant="h4" gutterBottom>
        Asha Worker Dashboard
      </Typography>

      <Paper sx={{ padding: 3, marginBottom: 3 }}>
        <Typography variant="h6" gutterBottom>
          Disease Distribution
        </Typography>
        <Box sx={{ width: "300px", margin: "auto" }}>
          <Pie data={data} />
        </Box>
      </Paper>

      <Paper sx={{ padding: 3 }}>
        <Typography variant="h6" gutterBottom>
          Prescriptions
        </Typography>
        <List>
          {prescriptions.map((prescription) => (
            <ListItem key={prescription.id}>
              <ListItemText
                primary={prescription.patient}
                secondary={prescription.prescription}
              />
            </ListItem>
          ))}
        </List>
      </Paper>
    </Box>
  );
};

export default AshaDashboard;
